var tipuesearch = {"pages": [{'title': 'About', 'text': 'This is  https://github.com/mdecourse/cmstemplate \n', 'tags': '', 'url': 'About.html'}, {'title': 'STAGE1', 'text': '', 'tags': '', 'url': 'STAGE1.html'}, {'title': 'w1', 'text': '創建網站 \n 修改leo \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '經過與組員討論決定要做自動摺衣板 \n https://www.youtube.com/watch?v=vB0G4zdbkXg&ab_channel=%E6%B0%91%E8%A6%96%E6%96%B0%E8%81%9E%E7%B6%B2FormosaTVNewsnetwork \n 上網查詢資料，取決產品規格大小 \n \n 構圖 \n \n 運用3D繪圖軟體畫出產品 \n \n \n \n \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '建立組的網站 \n 修改圖 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': '將畫好的立體圖放入CoppeliaSi模擬 \n 發現最下面的軸沒設定好 \n \n 左右兩側的板會卡住 \n \n 無法往復作動 \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'STAGE2', 'text': '', 'tags': '', 'url': 'STAGE2.html'}, {'title': 'w5', 'text': '找stage2組員 \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '組員: \n 40823115黃歸吉 \n 40823140林子恩 \n 40823114張欽堯 \n 40823146蕭宏翔 \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '討論並繪圖 \n 底座 \n \n 齒輪箱 \n \n 齒輪參考數據 \n \n 1.斜底齒輪 \n \n 2.正交齒輪 \n 齒輪底軸 \n \n 手把 \n \n 手把軸 \n \n 馬 \n \n \n 上主軸 \n \n 連桿 \n \n \n 輪軸 \n \n 輪子 \n \n 約束軸 \n \n 組合圖 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '我負責小組報告的製作跟coppeliasim模擬 \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '期中報告 \n \n', 'tags': '', 'url': 'w9.html'}, {'title': 'STAGE3', 'text': '', 'tags': '', 'url': 'STAGE3.html'}, {'title': 'w10', 'text': '尋找8人一組的組員 \n 組員: \n 40823111許耀中 \n 40823115黃歸吉 \n 40823128 \n 40823120 \n 40823140林子恩 \n 40823124 \n 40823139 \n 40823126 \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w11', 'text': '創建分組網站 \n 分組網站網址: \n https://40823115.github.io/stage3-ag5/content/index.html \n 作業: \n 每週各組按照組員順序, 於每堂課程時段, 輪流由 2-3 名學員啟動 OBS + Youtube 直播 (每週每位學員均需輪流負責直播工作項目內容), 並在開播前將直播 URL 公布於課程 gitter, 以展示該時段該組針對 stage3 分組專題工作項目的協同過程. (即每週各組於上課時段均會有四段協同設計影片分別嵌入各負責直播錄影組員的網頁與分組網頁). \n 各直播錄影時段, 各直播組員 (2-3 名) 應先規劃進行中工作項目的網際簡報資料, 並依照簡報內容逐一介紹所要展示或討論的協同設計項目. \n 當其他組別在執行 stage3 分組專題內容碰到問題時, 應按照順序採取下列步驟解決問題: \n \n 利用協同直播錄影時段, 輔以網際簡報資料, 明確說明所遭遇之問題情境. \n 上述影片上傳並嵌入個人網站與分組網站後, 根據問題描述影片內容, 尋求其他組在其分段直播時段說明如何解題. \n \n 各組組員於進行 stage3 分組專題期間, 均應協同負責從 零組件設計繪圖 , \xa0 零件轉檔 , 零組件轉入 \xa0 CoppeliaSim 進行設定 , \xa0 Lua 監控 , \xa0 Python 監控 , \xa0 直播錄影 , ssh 維護 個人網際簡報 , ssh 維護 個人網站 , 並協同參與維護 分組網站 等工作項目, 若過程中遭遇問題, 則根據上述步驟進行解題. \n 直播前: 準備網際投影片 \n 開啟直播: 將直播投影片(即直播主題) 與直播連結登錄在 \xa0 https://gitter.im/mdecourse/cd2021 \n 直播結束後: 將影片嵌入個人與分組網頁後, 連結繳交至 \xa0 https://github.com/mdecourse/cd2021/discussions/24 \n', 'tags': '', 'url': 'w11.html'}, {'title': 'task1', 'text': '讀取 stage3_2a.txt, 建立 Stage3 的分組倉儲, 分組網頁, 以及各組員倉儲及網頁連結 \n', 'tags': '', 'url': 'task1.html'}, {'title': 'task2', 'text': '\n 至網站下載，解壓縮，並將2.3.4檔案也放進相同之料夾 \n \n 將ttt檔丟入coppelasim進行操 \n \n 將老師所提供的bubbleRob_remoteAPI.Py放入stage1.2的作品裡面進行模擬 \n \n stage1 \n \n \n stage2 \n ; \n', 'tags': '', 'url': 'task2.html'}, {'title': 'w12', 'text': '被抽到線上直播 \n 第一次講解reveal \n \n 第二次講解怎模創建網站 \n \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '', 'tags': '', 'url': 'w14.html'}, {'title': 'tsak4', 'text': '\n 自行利用 SolidWorks, Inventor, NX, Onshape 或 Solvespace 繪製機械手臂零組件後, 分別以 ASCII STL 或 Binary STL 手動轉入 Coppeliasim 建立機械手臂 .ttm 模型備用. \n 根據 CoppeliaSim 4.1.0 版 (4.2.0 無法開啟 .simplescene.xml 檔案) 中的 \xa0 XML simplescene 格式 , 利用 Python 程式建立所需的機械手臂 .ttm 模型備用. \n 根據 RoKiSim 中的六軸機械手臂定義, 以 Python 程式, 將既有的 Industrial Robots STL 轉為 CoppeliaSim simplexml 模型格式備用. \n 將上述完成的機械手臂模型導入場景後, 機械手臂末端利用 force sensor 接上 components/grippers/suction pad.ttm tool 後, 先完成 MTB Robot 取放 Block 範例的改寫, 再完成 \xa0 FANUC M-710iC/50 \xa0 機械手臂的 圓球取放範例 . \n \n', 'tags': '', 'url': 'tsak4.html'}, {'title': 'w15', 'text': '運動學1 \n \n', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '', 'tags': '', 'url': 'w16.html'}, {'title': 'w17', 'text': '', 'tags': '', 'url': 'w17.html'}, {'title': 'w18', 'text': '', 'tags': '', 'url': 'w18.html'}]};